    }

    render () {
        return(
        <div className="inner-container">
            <div className="header">
              SIGN IN
            </div>

            <div className="box">

                <div className="input-group">

                  <label htmlFor="email">Email</label>
                  <input type="text" name="email" className="login-input" placeholder="Your email address"/>
                </div>

                <div className="input-group">

                  <label htmlFor="pwd">Password</label>
                  <input type="text" name="pwd" className="login-input" placeholder="Password"/>
                </div>

            <button type="button" className="login-btn" onClick={loginButton.bind(this)}>Sign in</button>

            </div>


        </div>
        );
    }

}

class RegisterBox extends React.Component {

    constructor(props) {
