    render () {
        return(
        <div className="inner-container">
            <div className="header">
              REGISTER
            </div>
            <div className="box">

                <div className="input-group">

                  <label htmlFor="email">Email</label>
                  <input type="text" name="email" className="reg-input" placeholder="Your email address"/>
                </div>

                <div className="input-group">

                  <label htmlFor="pwd">Password</label>
                  <input type="text" name="pwd" className="reg-input" placeholder="Password"/>
                </div>

            <button type="button" className="reg-btn" onClick={registerButton.bind(this)}>Sign in</button>

            </div>


        </div>
        );
    }

}

const rootElement = document.getElementById("root");
